import React from "react";
import logo from "./loho.png";
import "../App.css";
import { useState } from "react";

const Login = ({ checkLogin, handleRegister }) => {
  const [user, setUser] = useState("");
  const [pass, setPass] = useState("");

  const handleOnSubmit = (e) => {
    e.preventDefault();

    if (!user || !pass) {
      alert("Enter the credentials");
      return;
    }

    users.forEach((element) => {
      if (element.username === guest.user) {
        if (element.password === guest.pass) setType(1);
      }
    });

    admins.forEach((element) => {
      if (element.username === guest.user) {
        if (element.password === guest.pass) setType(2);
      }
    });

    setUser("");
    setPass("");
  };

  return (
    <div className="App">
      <img src={logo} className="logo" />
      <form className="form" onSubmit={handleOnSubmit}>
        <div className="input-group">
          <label>Username</label>
          <input
            type="text"
            value={user}
            placeholder="Enter username"
            onChange={(e) => setUser(e.target.value)}
          />
        </div>
        <div className="input-group">
          <label>Password</label>
          <input
            type="password"
            value={pass}
            placeholder="Enter password"
            onChange={(e) => setPass(e.target.value)}
          />
        </div>
        <button className="primary">Login</button>
      </form>
      <a href="http://localhost:3000/register">
        <button className="secondary">Register</button>
      </a>
    </div>
  );
};

export default Login;
